input:
{
  "question": "how to improve Attension calculation efficiency?",
  "chat_history": [
    {
      "inputs": {
        "question": "how to calculate Attention?"
      },
      "outputs": {
        "output": "To calculate attention, we use a compatibility function of the query with the corresponding key, and then compute the dot products of the query with all keys, divide each by the square root of the dimension of the keys, and apply a softmax function to obtain the weights on the values. This is known as Scaled Dot-Product Attention. (Source: azureml://locations/centralus/workspaces/e96a5813-c919-42fc-b816-908261dd06ab/data/vector-index-input-1706775617472/versions/1/1706.03762.pdf)"
      }
    }
  ]
}

output:
{
  "output": "One way to improve the efficiency of attention calculation is to use dot-product attention, which is faster and more space-efficient than additive attention. Additionally, multi-head attention can be used to linearly project the queries, keys, and values multiple times with different, learned linear projections to different dimensions, and then perform the attention function in parallel on each of these projected versions. This can improve the model's performance while also being more parallelizable and requiring less time to train. (Source: azureml://locations/centralus/workspaces/e96a5813-c919-42fc-b816-908261dd06ab/data/vector-index-input-1706775617472/versions/1/1706.03762.pdf)"
}

