 the previous decoder layer,\\\\\\\\nand the memory keys and values come from the output of the encoder. This allows every\\\\\\\\nposition in the decoder to attend over all positions in the input sequence. This mimics the\\\\\\\\ntypical encoder-decoder attention mechanisms in sequence-to-sequence models such as\\\\\\\\n[38, 2, 9].\\\\\\\\n\\\\\\\\u2022The encoder contains self-attention layers. In a self-attention layer all of the keys, values\\\\\\\\nand queries come from the same place, in this case, the output of the previous layer in the\\\\\\\\nencoder. Each position in the encoder can attend to all positions in the previous layer of the\\\\\\\\nencoder.\\\\\\\\n\\\\\\\\u2022Similarly, self-attention layers in the decoder allow each position in the decoder to attend to\\\\\\\\nall positions in the decoder up to and including that position. We need to prevent leftward\\\\\\\\ninformation flow in the decoder to preserve the auto-regressive property. We implement this\\\\\\\\ninside of scaled dot-product attention by masking out (setting to \\\\\\\\u2212\\\\\\\\u221e) all values in the input\\\\\\\\nof the softmax which correspond to illegal connections. See Figure 2.\\\\\\\\n3.3 Position-wise Feed-Forward Networks\\\\\\\\nIn addition to attention sub-layers, each of the layers in our encoder and decoder contains a fully\\\\\\\\nconnected feed-forward network, which is applied to each position separately and identically. This\\\\\\\\nconsists of two linear transformations with a ReLU activation in between.\\\\\\\\nFFN( x) = max(0 , xW 1+b1)W2+b2 (2)\\\\\\\\nWhile the linear transformations are the same across different positions, they use different parameters\\\\\\\\nfrom layer to layer. Another way of describing this is as two convolutions with kernel size 1.\\\\\\\\nThe dimensionality of input and output is dmodel = 512 , and the inner-layer has dimensionality\\\\\\\\ndff= 2048 .\\\\\\\\n3.4 Embeddings and Softmax\\\\\\\\nSimilarly to other sequence transduction models, we use learned embeddings to convert the input\\\\\\\\ntokens and output tokens to vectors of dimension dmodel. We also use the usual learned linear transfor-\\\\\\\\nmation and softmax function to convert the decoder output to predicted next-token probabilities. In\\\\\\\\nour model, we share the same weight matrix between the two embedding layers and the pre-softmax\\\\\\\\nlinear transformation, similar to [ 30]. In the embedding layers, we multiply those weights by\\\\\\\\u221admodel.\\\\\\\\n5\\\\\\\",\\\\n        \\\\\\\"document.score\\\\\\\": 0.3867444396018982,\\\\n        \\\\\\\"document.metadata\\\\\\\": {\\\\n            \\\\\\\"source_doc_id\\\\\\\": \\\\\\\"1706.03762.pdf4\\\\\\\",\\\\n            \\\\\\\"chunk_hash\\\\\\\": \\\\\\\"b0907ffb4546970af003d72d3c66917f5f097f5428599ff50f68323e538f0da6\\\\\\\",\\\\n            \\\\\\\"mtime\\\\\\\": null,\\\\n            \\\\\\\"page_number\\\\\\\": 4,\\\\n            \\\\\\\"stats\\\\\\\": {\\\\n                \\\\\\\"tiktokens\\\\\\\": 743,\\\\n                \\\\\\\"chars\\\\\\\": 3190,\\\\n                \\\\\\\"lines\\\\\\\": 49\\\\n            },\\\\n            \\\\\\\"source\\\\\\\": {\\\\n                \\\\\\\"filename\\\\\\\": \\\\\\\"1706.03762.pdf\\\\\\\",\\\\n                \\\\\\\"url\\\\\\\": \\\\\\\"azureml://locations/centralus/workspaces/e96a5813-c919-42fc-b816-908261dd06ab/data/vector-index-input-1706775617472/versions/1/1706.03762.pdf\\\\\\\",\\\\n                \\\\\\\"mtime\\\\\\\": 1706775620.0\\\\n            }\\\\n        }\\\\n    }\\\\n]\\\",\\\"retrieval.query\\\":\\\"How can attention be calculated in machine learning models?\\\",\\\"span_type\\\":\\\"Retrieval\\\"}\", \"context\": \"{\\\"span_id\\\":\\\"0xf853c85fdfd565fc\\\",\\\"trace_id\\\":\\\"0x1f1ba2e1d4bdeb64c858cd9c0fc941cf\\\",\\\"trace_state\\\":\\\"[]\\\"}\", \"end_time\": \"2024-02-05T15:00:35.377829\", \"events\": \"[]\", \"kind\": \"SpanKind.INTERNAL\", \"links\": \"[]\", \"name\": \"search\", \"p