-attention layers. In a self-attention layer all of the keys, values\\\\\\\\nand queries come from the same place, in this case, the output of the previous layer in the\\\\\\\\nencoder. Each position in the encoder can attend to all positions in the previous layer of the\\\\\\\\nencoder.\\\\\\\\n\\\\\\\\u2022Similarly, self-attention layers in the decoder allow each position in the decoder to attend to\\\\\\\\nall positions in the decoder up to and including that position. We need to prevent leftward\\\\\\\\ninformation flow in the decoder to preserve the auto-regressive property. We implement this\\\\\\\\ninside of scaled dot-product attention by masking out (setting to \\\\\\\\u2212\\\\\\\\u221e) all values in the input\\\\\\\\nof the softmax which correspond to illegal connections. See Figure 2.\\\\\\\\n3.3 Position-wise Feed-Forward Networks\\\\\\\\nIn addition to attention sub-layers, each of the layers in our encoder and decoder contains a fully\\\\\\\\nconnected feed-forward network, which is applied to each position separately and identically. This\\\\\\\\nconsists of two linear transformations with a ReLU activation in between.\\\\\\\\nFFN( x) = max(0 , xW 1+b1)W2+b2 (2)\\\\\\\\nWhile the linear transformations are the same across different positions, they use different parameters\\\\\\\\nfrom layer to layer. Another way of describing this is as two convolutions with kernel size 1.\\\\\\\\nThe dimensionality of input and output is dmodel = 512 , and the inner-layer has dimensionality\\\\\\\\ndff= 2048 .\\\\\\\\n3.4 Embeddings and Softmax\\\\\\\\nSimilarly to other sequence transduction models, we use learned embeddings to convert the input\\\\\\\\ntokens and output tokens to vectors of dimension dmodel. We also use the usual learned linear transfor-\\\\\\\\nmation and softmax function to convert the decoder output to predicted next-token probabilities. In\\\\\\\\nour model, we share the same weight matrix between the two embedding layers and the pre-softmax\\\\\\\\nlinear transformation, similar to [ 30]. In the embedding layers, we multiply those weights by\\\\\\\\u221admodel.\\\\\\\\n5\\\\\\\\nSource: azureml://locations/centralus/workspaces/e96a5813-c919-42fc-b816-908261dd06ab/data/vector-index-input-1706775617472/versions/1/1706.03762.pdf \\\\\\\\n\\\\\\\\n chat history:\\\\\\\"\\\\n    },\\\\n    {\\\\n      \\\\\\\"role\\\\\\\": \\\\\\\"user\\\\\\\",\\\\n      \\\\\\\"content\\\\\\\": \\\\\\\"what's Attention?\\\\\\\"\\\\n    },\\\\n    {\\\\n      \\\\\\\"role\\\\\\\": \\\\\\\"assistant\\\\\\\",\\\\n      \\\\\\\"content\\\\\\\": \\\\\\\"Attention is a mechanism used in machine learning models to focus on specific parts of input data when making predictions or generating output. It allows the model to selectively weigh different parts of the input, giving more importance to certain aspects and ignoring others. (Source: 1706.03762.pdf) \\\\\\\\nuser: how to calculate Attention? \\\\\\\\nassistant:\\\\\\\"\\\\n    }\\\\n  ],\\\\n  \\\\\\\"temperature\\\\\\\": 0.0,\\\\n  \\\\\\\"top_p\\\\\\\": 1.0,\\\\n  \\\\\\\"n\\\\\\\": 1,\\\\n  \\\\\\\"stream\\\\\\\": false,\\\\n  \\\\\\\"stop\\\\\\\": null,\\\\n  \\\\\\\"max_tokens\\\\\\\": 1000,\\\\n  \\\\\\\"presence_penalty\\\\\\\": 0.0,\\\\n  \\\\\\\"frequency_penalty\\\\\\\": 0.0,\\\\n  \\\\\\\"logit_bias\\\\\\\": {},\\\\n  \\\\\\\"user\\\\\\\": \\\\\\\"\\\\\\\",\\\\n  \\\\\\\"response_format\\\\\\\": null\\\\n}\\\",\\\"line_run_id\\\":\\\"371856bd-457d-490c-8f4e-69f825b727d1\\\",\\\"node_name\\\":\\\"answer_the_question_with_context\\\",\\\"output\\\":\\\"{\\\\n  \\\\\\\"id\\\\\\\": \\\\\\\"chatcmpl-8oukVwdxBlTok7CeTJgzgw2kZXOlp\\\\\\\",\\\\n  \\\\\\\"choices\\\\\\\": [\\\\n    {\\\\n      \\\\\\\"finish_reason\\\\\\\": \\\\\\\"stop\\\\\\\",\\\\n      \\\\\\\"index\\\\\\\": 0,\\\\n      \\\\\\\"logprobs\\\\\\\": null,\\\\n      \\\\\\\"message\\\\\\\": {\\\\n        \\\\\\\"content\\\\\\\": \\\\\\\"There are different ways to calculate attention, but one commonly used m