nnew\\\\\\\\nlaws\\\\\\\\nsince\\\\\\\\n2009\\\\\\\\nmaking\\\\\\\\nthe\\\\\\\\nregistration\\\\\\\\nor\\\\\\\\nvoting\\\\\\\\nprocess\\\\\\\\nmore\\\\\\\\ndifficult\\\\\\\\n.\\\\\\\\n<EOS>\\\\\\\\n<pad>\\\\\\\\n<pad>\\\\\\\\n<pad>\\\\\\\\n<pad>\\\\\\\\n<pad>\\\\\\\\n<pad>\\\\\\\\nFigure 3: An example of the attention mechanism following long-distance dependencies in the\\\\\\\\nencoder self-attention in layer 5 of 6. Many of the attention heads attend to a distant dependency of\\\\\\\\nthe verb \\\\\\\\u2018making\\\\\\\\u2019, completing the phrase \\\\\\\\u2018making...more difficult\\\\\\\\u2019. Attentions here shown only for\\\\\\\\nthe word \\\\\\\\u2018making\\\\\\\\u2019. Different colors represent different heads. Best viewed in color.\\\\\\\\n13\\\\\\\",\\\\n        \\\\\\\"document.score\\\\\\\": 0.4060562551021576,\\\\n        \\\\\\\"document.metadata\\\\\\\": {\\\\n            \\\\\\\"source_doc_id\\\\\\\": \\\\\\\"1706.03762.pdf12\\\\\\\",\\\\n            \\\\\\\"chunk_hash\\\\\\\": \\\\\\\"2ab3047247294a730f42d2e9fb421bfa7bcf724d98adf2714c6566d1d3199abd\\\\\\\",\\\\n            \\\\\\\"mtime\\\\\\\": null,\\\\n            \\\\\\\"page_number\\\\\\\": 12,\\\\n            \\\\\\\"stats\\\\\\\": {\\\\n                \\\\\\\"tiktokens\\\\\\\": 254,\\\\n                \\\\\\\"chars\\\\\\\": 833,\\\\n                \\\\\\\"lines\\\\\\\": 73\\\\n            },\\\\n            \\\\\\\"source\\\\\\\": {\\\\n                \\\\\\\"filename\\\\\\\": \\\\\\\"1706.03762.pdf\\\\\\\",\\\\n                \\\\\\\"url\\\\\\\": \\\\\\\"azureml://locations/centralus/workspaces/e96a5813-c919-42fc-b816-908261dd06ab/data/vector-index-input-1706775617472/versions/1/1706.03762.pdf\\\\\\\",\\\\n                \\\\\\\"mtime\\\\\\\": 1706775620.0\\\\n            }\\\\n        }\\\\n    },\\\\n    {\\\\n        \\\\\\\"document.content\\\\\\\": \\\\\\\"Title: 1706.03762.pdfProvided proper attribution is provided, Google hereby grants permission to\\\\\\\\nreproduce the tables and figures in this paper solely for use in journalistic or\\\\\\\\nscholarly works.\\\\\\\\nAttention Is All You Need\\\\\\\\nAshish Vaswani\\\\\\\\u2217\\\\\\\\nGoogle Brain\\\\\\\\navaswani@google.comNoam Shazeer\\\\\\\\u2217\\\\\\\\nGoogle Brain\\\\\\\\nnoam@google.comNiki Parmar\\\\\\\\u2217\\\\\\\\nGoogle Research\\\\\\\\nnikip@google.comJakob Uszkoreit\\\\\\\\u2217\\\\\\\\nGoogle Research\\\\\\\\nusz@google.com\\\\\\\\nLlion Jones\\\\\\\\u2217\\\\\\\\nGoogle Research\\\\\\\\nllion@google.comAidan N. Gomez\\\\\\\\u2217 \\\\\\\\u2020\\\\\\\\nUniversity of Toronto\\\\\\\\naidan@cs.toronto.edu\\\\\\\\u0141ukasz Kaiser\\\\\\\\u2217\\\\\\\\nGoogle Brain\\\\\\\\nlukaszkaiser@google.com\\\\\\\\nIllia Polosukhin\\\\\\\\u2217 \\\\\\\\u2021\\\\\\\\nillia.polosukhin@gmail.com\\\\\\\\nAbstract\\\\\\\\nThe dominant sequence transduction models are based on complex recurrent or\\\\\\\\nconvolutional neural networks that include an encoder and a decoder. The best\\\\\\\\nperforming models also connect the encoder and decoder through an attention\\\\\\\\nmechanism. We propose a new simple network architecture, the Transformer,\\\\\\\\nbased solely on attention mechanisms, dispensing with recurrence and convolutions\\\\\\\\nentirely. Experiments on two machine translation tasks show these models to\\\\\\\\nbe superior in quality while being more parallelizable and requiring significantly\\\\\\\\nless time to train. Our model achieves 28.4 BLEU on the WMT 2014 English-\\\\\\\\nto-German translation task, improving over the existing best results, including\\\\\\\\nensembles, by over 2 BLEU. On the WMT 2014 English-to-French translation task,\\\\\\\\nour model establishes a new single-model state-of-the-art BLEU score of 41.8 after\\\\\\\\ntraining for 3.5 days on eight GPUs, a small fraction of the training costs of the\\\\\\\\nbest models from the literature. We show that the Transformer generalizes well to\\\\\\\\nother tasks by applying it successfully to English constituency parsing both with\\\\\\\\nlarge and limited training data.\\\\\\\\n\\\\\\\\u2217Equal contribution. Listing order is random. Jakob proposed replacing RNNs with self-attention and started\\\\\\\\nthe effort to evaluate this idea. Ashish, with Illia, designed and implemented the first Transformer models and\\\\\\\\nhas been crucially involved in every aspect of this work. Noam proposed scaled dot-product attention, multi-head\\\\\\\\nattention and the parameter-free position representation and became the other person involved in nearly every\\\\\\\\ndetail. Niki designed, implemented, tuned and evaluated countless model variants in our original codebase and\\\\\\\\ntensor2tensor. Llion also experimented with novel model variants, was responsible for our initial codebase, and\\\\\\\\nefficient inference and visualizations. Lukasz and Aidan spent countless long days designing various parts of and\\\\\\\\nimplementing tensor2tensor, replacing our earlier codebase, greatly improving results and massively accelerating\\\\\\\\nour research.\\\\\\\\n\\\\\\\\u2020Work performed while at Google Brain.\\\\\\\\n\\\\\\\\u2021Work performed while at Google Research.\\\\\\\\n31st Conference on Neural Information Processing Systems (NIPS 2017), Long Beach, CA, USA.arXiv:1706.03762v7  [cs.CL]  2 Aug 2023\\\\\\\",\\\\n        \\\\\\\"document.score\\\\\\\": 0.41361039876937866,\\\\n        \\\\\\\"document.metadata\\\\\\\": {\\\\n            \\\\\\\"source_doc_id\\\\\\\": \\\\\\\"1706.03762.pdf0\\\\\\\",\\\\n            \\\\\\\"chunk_hash\\\\\\\": \\\\\\\"c75669a2c4ea0f4ddb0e7b2c4e85534297615151bb8e8dfef1d05b62aa134744\\\\\\\",\\\\n            \\\\\\\"mtime\\\\\\\": null,\\\\n            \\\\\\\"page_number\\\\\\\": 0,\\\\n            \\\\\\\"stats\\\\\\\": {\\\\n                \\\\\\\"tiktokens\\\\\\\": 668,\\\\n                \\\\\\\"chars\\\\\\\": 2874,\\\\n                \\\\\\\"lines\\\\\\\": 50\\\\n            },\\\\n            \\\\\\\"source\\\\\\\": {\\\\n           