machine translation tasks show these models to\\\\nbe superior in quality while being more parallelizable and requiring significantly\\\\nless time to train. Our model achieves 28.4 BLEU on the WMT 2014 English-\\\\nto-German translation task, improving over the existing best results, including\\\\nensembles, by over 2 BLEU. On the WMT 2014 English-to-French translation task,\\\\nour model establishes a new single-model state-of-the-art BLEU score of 41.8 after\\\\ntraining for 3.5 days on eight GPUs, a small fraction of the training costs of the\\\\nbest models from the literature. We show that the Transformer generalizes well to\\\\nother tasks by applying it successfully to English constituency parsing both with\\\\nlarge and limited training data.\\\\n\\\\u2217Equal contribution. Listing order is random. Jakob proposed replacing RNNs with self-attention and started\\\\nthe effort to evaluate this idea. Ashish, with Illia, designed and implemented the first Transformer models and\\\\nhas been crucially involved in every aspect of this work. Noam proposed scaled dot-product attention, multi-head\\\\nattention and the parameter-free position representation and became the other person involved in nearly every\\\\ndetail. Niki designed, implemented, tuned and evaluated countless model variants in our original codebase and\\\\ntensor2tensor. Llion also experimented with novel model variants, was responsible for our initial codebase, and\\\\nefficient inference and visualizations. Lukasz and Aidan spent countless long days designing various parts of and\\\\nimplementing tensor2tensor, replacing our earlier codebase, greatly improving results and massively accelerating\\\\nour research.\\\\n\\\\u2020Work performed while at Google Brain.\\\\n\\\\u2021Work performed while at Google Research.\\\\n31st Conference on Neural Information Processing Systems (NIPS 2017), Long Beach, CA, USA.arXiv:1706.03762v7  [cs.CL]  2 Aug 2023\\\\nSource: azureml://locations/centralus/workspaces/e96a5813-c919-42fc-b816-908261dd06ab/data/vector-index-input-1706775617472/versions/1/1706.03762.pdf\\\"\",\"root_run_id\":\"\",\"span_type\":\"Tool\"}", "context": "{\"span_id\":\"0x738af6353c39177f\",\"trace_id\":\"0x5b050648eab9bb1d00da1700e21352d2\",\"trace_state\":\"[]\"}", "end_time": "2024-02-05T15:55:46.673692", "events": "[]", "kind": "SpanKind.INTERNAL", "links": "[]", "name": "generate_prompt_context", "parent_id": "0x40962014af720857", "resource": "{\"attributes\":{\"service.name\":\"promptflow\"},\"schema_url\":\"\"}", "start_time": "2024-02-05T15:55:46.666888", "status": "OK", "trace_id": "0x5b050648eab9bb1d00da1700e21352d2", "span_id": "0x738af6353c39177f", "span_type": "Tool", "framework": "promptflow", "input": "{\n  \"search_result\": [\n    [\n      {\n        \"text\": \"Title: 1706.03762.pdfScaled Dot-Product Attention\\n Multi-Head Attention\\nFigure 2: (left) Scaled Dot-Product Attention. (right) Multi-Head Attention consists of several\\nattention layers running in parallel.\\nof the values, where the weight assigned to each value is computed by a compatibility function of the\\nquery with the corresponding key.\\n3.2.1 Scaled Dot-Product Attention\\nWe call our particular attention \\\"Scaled Dot-Product Attention\\\" (Figure 2). The input consists of\\nqueries and keys of dimension dk, and values of dimension dv. We compute the dot products of the\\nquery with all keys, divide each by\\u221adk, and apply a softmax function to obtain the weights on the\\nvalues.\\nIn practice, we compute the attention function on a set of queries simultaneously, packed together\\ninto a matrix Q. The keys and values are also packed together into matrices KandV. We compute\\nthe matrix of outputs as:\\nAttention( Q, K, V ) = softmax(QKT\\n\\u221adk)V (1)\\nThe two most commonly used attention functions are additive attention [ 2], and dot-product (multi-\\nplicative) attention. Dot-product attention is identical to our algorithm, except for the scaling factor\\nof1\\u221adk. Additive attention computes the compatibility function using a feed-forward network with\\na single hidden layer. While the two are similar in theoretical complexity, dot-product attention is\\nmuch faster and more space-efficient in practice, since it can be implemented using highly optimized\\nmatrix multiplication code.\\nWhile for small values of dkthe two mechanisms perform similarly, additive attention outperforms\\ndot product attention without scaling for larger values of dk[3]. We suspect that for large values of\\ndk, the dot products grow large in magnitude, pushing the softmax function into regions where it has\\nextremely small gradients4. To counteract this effect, we scale the dot products by1\\u221adk.\\n3.2.2 Multi-Head Attention\\nInstead of performing a single attention function with dmodel-dimensional keys, values and queries,\\nwe found it beneficial to linearly project the queries, keys and values htimes with different, learned\\nlinear projections to dk,dkanddvdimensions, respectively. On each of these projected versions of\\nqueries, keys and values we then perform the attention function in parallel, yielding dv-dimensional\\n4To illustrate why the dot products get large, assume that the components of qandkare independent random\\nvariables with mean 0and variance 1. Then their dot product, q\\u00b7k=Pdk\\ni=1qiki, has mean 0and variance dk.\\n4\",\n        \"metadata\": {\n          \"source_doc_id\": \"1706.03762.pdf3\",\n          \"chunk_hash\": \"5e70d3f796a778829940a4e9a74ec45d4b77ab22a6d4528922932a29f8efe7eb\",\n          \"mtime\": null,\n          \"page_number\": 3,\n          \"stats\": {\n            \"tiktokens\": 551,\n            \"chars\": 2502,\n            \"lines\": 35\n          },\n          \"source\": {\n            \"filename\": \"1706.03762.pdf\",\n            \"url\": \"azureml://locations/centralus/workspaces/e96a5813-c919-42fc-b816-908261dd06ab/data/vector-index-input-1706775617472/versions/1/1